import React from 'react';
import Sketch from "react-p5";
import p5Types from "p5";
import './Dashboard.css';

export default function Dashboard()
{
  const   width = 1300;
	const   height = 600;
  const Xb = width / 20;
  const Yb = height / 20;
  var exp = false;
  var sep = false;
  var structX: number[] = [];
  var structY: number[] = [];

  let Board =  new Array(Xb * Yb).fill(0);

  const setup = (p5: p5Types, canvasParentRef: Element) => {
		p5.createCanvas(width, height).parent(canvasParentRef);
    p5.stroke(50); // Set line drawing color to white
    p5.frameRate(30);

		p5.background('#222222')

    for (let i = 0; i < 1300; i+=20) {
      p5.line(i, 0, i, 1300);
    }
    for (let i = 0; i < 600; i+=20) {
      p5.line(0, i, 1300, i);
    }

    Board[5] = 1;
    console.table(Board);
    for (let i = 0; i < Xb; i++) 
    {
      for (let j = 0; j < Yb; j++) 
      {
        if (Board[j * Xb + i] === 0){
          p5.fill("white");
          p5.square(i * 20, j * 20, 20);
          p5.noFill();
        }
        else
        {
          p5.fill("black");
          p5.square(i * 20, j * 20, 20);
          p5.noFill();
        }
      }
    }

  };

	const draw = (p5: p5Types) => {
    var isFound = false;

    p5.background('#222222')
    for (let i = 0; i < Xb; i++) 
      {
        for (let j = 0; j < Yb; j++) 
        {
          if (Board[j * Xb + i] === 0){
            p5.fill("white");
            p5.square(i * 20, j * 20, 20);
            p5.noFill();
          }
          else if (Board[j * Xb + i] === 2)
          {
            p5.fill("red");
            p5.square(i * 20, j * 20, 20);
            p5.text("X = " + (i * 20) + ", " + (j * 20), i * 20 + 5 ,j * 20 + 15);
            p5.noFill();
          }
          else if (Board[j * Xb + i] === 3)
          {
            p5.fill("green");
            p5.square(i * 20, j * 20, 20);
            p5.noFill();
          }
          else if (Board[j * Xb + i] === 4)
          {
            p5.fill("brown");
            p5.square(i * 20, j * 20, 20);
            p5.noFill();
          }
          else
          {
            p5.fill("black");
            p5.square(i * 20, j * 20, 20);
            p5.noFill();
          }
        }
    }

    p5.text(p5.key, 110,115);

    if (p5.key === 's' && exp === false)
    {

      p5.fill("red");
      let x = Math.round(p5.mouseX / 20) * 20;
      let y = Math.round(p5.mouseY / 20) * 20;
      console.log("hello " , x, y);
      p5.square(x, y, 20);

      if (p5.mouseIsPressed === true && p5.mouseButton === p5.LEFT)
      {
        p5.fill("yellow");
        p5.square(x, y, 20);
        Board[Math.round(y / 20) * Xb + Math.round(x / 20)] = 2;
        exp = true;
        structX.push(x);
        structX.push(y);
      }
    }
    if (p5.key === 'e' && sep === false)
    {

      p5.fill("green");
      let x = Math.round(p5.mouseX / 20) * 20;
      let y = Math.round(p5.mouseY / 20) * 20;
      console.log("hello " , x, y);
      p5.square(x, y, 20);

      if (p5.mouseIsPressed === true && p5.mouseButton === p5.LEFT)
      {
        p5.fill("yellow");
        p5.square(x, y, 20);
        Board[Math.round(y / 20) * Xb + Math.round(x / 20)] = 3;
        sep = true;
        structY.push(x);
        structY.push(y);
      }
    }
    if (p5.key === 'w')
    {
      p5.fill("brown");
      let x = Math.round(p5.mouseX / 20) * 20;
      let y = Math.round(p5.mouseY / 20) * 20;
      console.log("hello " , x, y);
      p5.square(x, y, 20);

      if (p5.mouseIsPressed === true && p5.mouseButton === p5.LEFT)
      {
        p5.fill("yellow");
        p5.square(x, y, 20);
        Board[Math.round(y / 20) * Xb + Math.round(x / 20)] = 4;
        sep = true;
      }

    }
    if (p5.key === 'r')
    {
      exp = false;
      sep = false;
      for (let i = 0; i < Xb; i++) 
      {
        for (let j = 0; j < Yb; j++) 
          if (Board[j * Xb + i] === 2 || Board[j * Xb + i] === 3 || Board[j * Xb + i] === 4)
            Board[j * Xb + i] = 0;
      }
    }

    if (p5.key === 'p' && exp === true && sep === true && isFound === false)
    {
      FindYourPath(structX, structY);
      isFound = true;
    }

	};

  const FindYourPath = (X : any , Y : any) => {

    console.log("X = " + X[0] + ", " + X[1]);
    console.log("Y = " + Y[0] + ", " + Y[1]);
  }


  return(
    <div className='board'>
      <Sketch setup={setup} draw={draw} />
      <div className='board__info'>
        <div>Dashboard
          </div>
        <p>Press 's' to start drawing</p>
      </div>
    </div>
  )
}
